import numpy as np
from numba import njit

# @njit
def increasingTriplet(nums):
    n = len(nums)
    # print(n)
    for i in range(n):
        n1 = nums[i]
        for j in range(i+1, n):
            n2 = nums[j]
            for k in range(j+1, n):
                n3 = nums[k]
                if n1 < n2 < n3:
                    return True
    return False

